window.plugin.html.getText( id ){
 fr = Util.vc(id)
 return fr.innerHTML
}

window.plugin.html.setText( id, txt ){
 fr = Util.vc(id)
 fr.innerHTML = txt
}

window.plugin.html = function( dictionary ){
 var id = dictionary.id
 if(dictionary.client!=null){
  client = window[dictionary.client]
  client.editor( id, function(){ return window.plugin.html.getText(id) },	function(txt){ window.plugin.html.setText(id, txt) })
	}
}
